def __length_of_longest_substring(s: str) -> int:
    subs = []

    if len(s) == 0:
        return 0

    temp = ''
    for i in range(0, len(s)):
        for j in range(i, len(s)):
            temp += s[j]

            if j + 1 == len(s) or s[j + 1] in temp:
                subs.append(temp)
                temp = ''
                break

    print(subs)

    m = max([len(sub) for sub in subs])

    return m


def __length_of_longest_substring2(s: str) -> int:
    char_set = set()
    max_len, start = 0, 0
    for i, c in enumerate(s):
        while c in char_set:
            char_set.remove(s[start])
            start += 1
        char_set.add(c)
        max_len = max(max_len, i - start + 1)
    return max_len
